/*Table structure for table `roleGroup` */

DROP TABLE IF EXISTS `roleGroup`;

CREATE TABLE `roleGroup` (
  `id` varchar(255) NOT NULL,
  `roleId` varchar(255) DEFAULT NULL,
  `groupId` varchar(255) DEFAULT NULL,
  `status` smallint(6) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `roleGroup` */

/*Table structure for table `roleResource` */

DROP TABLE IF EXISTS `roleResource`;

CREATE TABLE `roleResource` (
  `id` varchar(255) NOT NULL,
  `roleId` varchar(255) DEFAULT NULL,
  `resourceId` varchar(255) DEFAULT NULL,
  `isEnabled` tinyint(4) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `roleResource` */

/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `id` varchar(255) NOT NULL,
  `realName` varchar(255) DEFAULT NULL,
  `username` varchar(255) DEFAULT NULL,
  `gender` varchar(10) DEFAULT NULL,
  `userCode` varchar(255) DEFAULT NULL,
  `status` smallint(6) DEFAULT NULL,
  `createdTime` datetime DEFAULT NULL,
  `updatedTime` datetime DEFAULT NULL,
  `mobile` varchar(255) DEFAULT NULL,
  `telephone` varchar(255) DEFAULT NULL,
  `email` varchar(255) DEFAULT NULL,
  `organizationId` varchar(255) DEFAULT NULL,
  `directLeaderId` varchar(255) DEFAULT NULL,
  `jobLevel` varchar(255) DEFAULT NULL,
  `password` varchar(255) DEFAULT NULL,
  `workplace` varchar(255) DEFAULT NULL,
  `birth` date DEFAULT NULL,
  `jobTitle` varchar(255) DEFAULT NULL,
  `company` varchar(255) DEFAULT NULL,
  `entryDate` varchar(255) DEFAULT NULL,
  `jobTitleDate` varchar(255) DEFAULT NULL,
  `contractStartDate` varchar(255) DEFAULT NULL,
  `probationEndDate` varchar(255) DEFAULT NULL,
  `positiveDate` varchar(255) DEFAULT NULL,
  `firstContractEndDate` varchar(255) DEFAULT NULL,
  `secondContractEndDate` varchar(255) DEFAULT NULL,
  `turnoverDate` varchar(255) DEFAULT NULL,
  `employeeStatus` varchar(255) DEFAULT NULL,
  `identity` varchar(255) DEFAULT NULL,
  `identityNumber` varchar(255) DEFAULT NULL,
  `age` smallint(6) DEFAULT NULL,
  `nation` varchar(255) DEFAULT NULL,
  `nationality` varchar(255) DEFAULT NULL,
  `education` varchar(255) DEFAULT NULL,
  `degree` varchar(255) DEFAULT NULL,
  `learningType` varchar(255) DEFAULT NULL,
  `politicalAffiliation` varchar(255) DEFAULT NULL,
  `workStartDate` varchar(255) DEFAULT NULL,
  `graduationTime` varchar(255) DEFAULT NULL,
  `familyRegister` varchar(255) DEFAULT NULL,
  `foreignEnglish` varchar(255) DEFAULT NULL,
  `foreignRussian` varchar(255) DEFAULT NULL,
  `foreignFrench` varchar(255) DEFAULT NULL,
  `foreignKorean` varchar(255) DEFAULT NULL,
  `foreignJapanese` varchar(255) DEFAULT NULL,
  `maritalStatus` varchar(255) DEFAULT NULL,
  `birthPlace` varchar(255) DEFAULT NULL,
  `salaryBank` varchar(255) DEFAULT NULL,
  `salaryBankNumber` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `INDEX_USERNAME` (`username`),
  KEY `INDEX_NAME_LIKE` (`realName`,`username`,`telephone`,`email`),
  KEY `INDEX_STATUS` (`status`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `user` */

